data.text:
@Hellotailface Muchos.

Pero nadie se suicida con un tiro de frente. 

Confirmamos, es asesinato.

@Sapiosexualiam La mancha de sangre que hay en la pared es incompatible con el suicidio (demasiado grande, baja atomización).
Al mismo tiempo, un suicida se mete normalmente la pistola en la boca, es más cómodo que en la pared.
El cigarro está en la mano, se hubiese caído.

@PDUmorista @Brigate_Azzurre @cantone_per Se non sei in grado, il black humour lo lasci fare a chi ne è capace.
Secondo me dovreste lasciare un alone di mistero, ma a ridere (tra l'altro solo tu e quella ameba di @_Ritter_17) dei bambini malati di cancro o di ragazze suicida, spoilerate a tutti la vostra essenza
⬇️⬇️⬇️⬇️ https://t.co/UXbj1IRlqr

@carlosclavijo22 Tomo nota de la recomendación 👌.
Tango suicida de Extremoduro,te cuenta la historia de un drama muy bien estructurado.
Quiero recalcar que no es ningún proyecto ni ninguna petición,solo una opinión que quería compartir contigo.

